import React, {FC} from "react";
import HeadColumn from "../HeadColumn";

export interface HeadRowProps {
    param: any
    id: number
    callback: FC
    value: any
}

function HeadRow({param, callback}:HeadRowProps) {
    let currentData = [];
    if (param && param.length !==0) {
        currentData = param.find((elem:any, index:number) => {
            if(index === 0) {
                return elem
            }
        })
    }
    return(
        <tr>
            {Object.keys(currentData).map(elem => {
                return <HeadColumn value={elem} id={elem} callback={callback}/>
            })}
        </tr>
    )
}

export default HeadRow
